em/20200103172918587_933663.jpg_100x100.jpg', '/tutu/system/20200103172920014_975469.jpg_100x100.jpg', '/tutu/system/20200103172921327_078690.jpg_100x100.jpg', '/tutu/system/20200103172921381_359502.jpg_100x100.jpg', '/tutu/system/20200103172921290_050851.jpg_100x100.jpg', '/tutu/system/20200103172921660_560205.jpg_100x100.jpg', '/tutu/system/20200103172921711_177876.jpg_100x100.jpg', '/tutu/system/20200103172922183_237433.jpg_100x100.jpg'], 'videoFallsUrl': '', 'videoFallsStandard': None, 'videoFallsLitimgUrl': '', 'videoUrl': '', 'content': '做了9年的美甲，差不多什么风格都尝试过。今年是杠上了延长甲，因为普通长度的指甲已经不能满足我的需求了哈哈哈。延长甲会显得手很细长，然后也能做很多图案，可以简单涂个透明色贴小钻，或者描绘复杂精美的花纹。最喜欢的就是可以加个小链子，亮闪闪的垂坠感，可以搭配同款耳环，日常注意点不要勾到衣服就好。黑色加金属片的看起来很有神秘感，适合搭配天鹅绒的长裙，很显气质，超有女神feel~', 'articleType': 1, 'articleStatus': 3, 'topicId': '4cb44ca2d8cb41fb9c71c64ee969e6ad', 'albumsId': '', 'ssenceType': 1, 'praiseNum': '4', 'shareNum': '2', 'viewsNum': '16', 'longitude': 114.05841092, 'latitude': 22.5400482, 'address': '', 'creatorId': '736ecbff6c1445e8a64f4b15518c3005', 'creatorName': '求你做个人', 'creatorPortrait': '/tutu/system/20200103172730110_117899.png', 'creatorPortraitLitimg': '/tutu/anjou/headportrait/20200103173000314_545192.png', 'createTime': '01-03 17:30', 'userPraise': False, 'distance': '7.9Km'}, {'id': '17cfb47eef7346508c1b27edcc1dbaa0', 'imagesFallsUrl': '/tutu/system/20200103171825622_353855.jpg', 'imagesFallsStandard': None, 'imagesFallsLitimgUrl': '/tutu/system/20200103171825622_353855.jpg_100x100.jpg', 'imagesUrls': ['/tutu/system/20200103171825622_353855.jpg', '/tutu/system/20200103171825841_311090.jpg', '/tutu/system/20200103171826447_322122.jpg', '/tutu/system/20200103171827700_201967.jpg', '/tutu/system/20200103171827763_280852.jpg', '/tutu/system/20200103171827923_761835.jpg', '/tutu/system/20200103171827980_823016.jpg'], 'imagesLitimgUrls': ['/tutu/system/20200103171825622_353855.jpg_100x100.jpg', '/tutu/system/20200103171825841_311090.jpg_100x100.jpg', '/tutu/system/20200103171826447_322122.jpg_100x100.jpg', '/tutu/system/20200103171827700_201967.jpg_100x100.jpg', '/tutu/system/20200103171827763_280852.jpg_100x100.jpg', '/tutu/system/20200103171827923_761835.jpg_100x100.jpg', '/tutu/system/20200103171827980_823016.jpg_100x100.jpg'], 'videoFallsUrl': '', 'videoFallsStandard': None, 'videoFallsLitimgUrl': '', 'videoUrl': '', 'content': '我比较喜欢渐变和晕染的美甲，搭配贝壳或者金属片，很性感的轻熟女风，平时都是搭配豹纹、黑色蕾丝裙或者皮草。看起来很高级。而且深色美甲显色度极高，炒鸡显手白哟~💕', 'articleType': 1, 'articleStatus': 3, 'topicId': '69c6b098d5aa48739f06cc7869e14793', 'albumsId': '', 'ssenceType': 1, 'praiseNum': '3', 'shareNum': '0', 'viewsNum': '5', 'longitude': 114.07964582, 'latitude': 22.70793097, 'address': '', 'creatorId': 'b5a35bf9aa4f4a0bb3babef47884d357', 'creatorName': '卿本佳人可倾天下', 'creatorPortrait': '/tutu/system/20200103171509213_344426.png', 'creatorPortraitLitimg': '/tutu/system/20200103171509213_344426.png_50x50.png', 'createTime': '01-03 17:19', 'userPraise': False, 'distance': '10.9Km'}, {'id': '477f720b69974f91a600749e49bef074', 'imagesFallsUrl': '/tutu/system/20200103173315496_876666.jpg', 'imagesFallsStandard': None, 'imagesFallsLitimgUrl': '/tutu/system/20200103173315496_876666.jpg_100x100.jpg', 'imagesUrls': ['/tutu/system/20200103173315496_876666.jpg', '/tutu/system/20200103173318208_531060.jpg', '/tutu/system/20200103173318640_500386.jpg', '/tutu/system/20200103173319538_080745.jpg', '/tutu/system/20200103173319725_642973.jpg', '/tutu/system/20200103173319849_992578.jpg'], 'imagesLitimgUrls': ['/tutu/system/20200103173315496_876666.jpg_100x100.jpg', '/tutu/system/20200103173318208_531060.jpg_100x100.jpg', '/tutu/system/20200103173318640_500386.jpg_100x100.jpg', '/tutu/system/20200103173319538_080745.jpg_100x100.jpg', '/tutu/system/20200103173319725_642973.jpg_100x100.jpg', '/tutu/system/20200103173319849_992578.jpg_100x100.jpg'], 'videoFallsUrl': '', 'videoFallsStandard': None, 'videoFallsLitimgUrl': '', 'videoUrl': '', 'content': '今年做的美甲风格不一，因为我很喜欢尝试各种各样不一样的颜色和搭配，导致有时候翻车了。但是有几款还是很喜欢哒！翡翠绿和磨砂绿是真的超级好看，有点小清新，夏天的时候做的了。我也会尝试带散粉的，女孩子都喜欢这种闪闪发光的甲油，玫瑰色和粉色搭配的也很好看，中间搭配一两个晕染的美甲，非常有活力哦！', 'articleType': 1, 'articleStatus': 3, 'topicId': '4cb44ca2d8cb41fb9c71c64ee969e6ad', 'albumsId': '', 'ssenceType': 1, 'praiseNum': '3', 'shareNum': '0', 'viewsNum': '15', 'longitude': 114.14219562, 'latitude': 22.72504446, 'address': '', 'creatorId': '6945dc7350e74c309b06d89d76e7f2a6', 'creatorName': '融化小冰块', 'creatorPortrait': '/tutu/system/20200103173156998_249485.png', 'creatorPortraitLitimg': '/tutu/system/20200103173156998_249485.png_50x50.png', 'createTime': '01-03 17:33', 'userPraise': False, 'distance': '15.0Km'}, {'id': 'a2f8bf7616604be49c22a3fa244ac19c', 'imagesFallsUrl': '/tutu/system/20200103172254469_520244.jpg', 'imagesFallsStandard': None, 'imagesFallsLitimgUrl': '/tutu/system/20200103172254469_520244.jpg_100x100.jpg', 'imagesUrls': ['/tutu/system/20200103172254469_520244.jpg', '/tutu/system/20200103172256019_544777.jpg', '/tutu/system/20200103172256637_486437.jpg', '/tutu/system/20200103172257328_388268.jpg', '/tutu/system/20200103172258322_536493.jpg', '/tutu/system/20200103172258378_523302.jpg'], 'imagesLitimgUrls': ['/tutu/system/20200103172254469_520244.jpg_100x100.jpg', '/tutu/system/20200103172256019_544777.jpg_100x100.jpg', '/tutu/system/20200103172256637_486437.jpg_100x100.jpg', '/tutu/system/20200103172257328_388268.jpg_100x100.jpg', '/tutu/system/20200103172258322_536493.jpg_100x100.jpg', '/tutu/system/20200103172258378_523302.jpg_100x100.jpg'], 'videoFallsUrl': '', 'videoFallsStandard': None, 'videoFallsLitimgUrl': '', 'videoUrl': '', 'content': '少女心的女孩子看过来~~马卡龙色、冰淇淋色是我的心头好，浅蓝色、粉红色、粉紫色都超级好看的，一般是格子纹或者小花点缀，然后搭配同色系的纯色，看起来活泼又可爱。装饰就点缀得比较少，最多在一两个美甲上贴一点小珍珠或者小贝壳，其他的保持原来的味道就好啦~很小清新噢~', 'articleType': 1, 'articleStatus': 3, 'topicId': '4cb44ca2d8cb41fb9c71c64ee969e6ad', 'albumsId': '', 'ssenceType': 1, 'praiseNum': '4', 'shareNum': '0', 'viewsNum': '33', 'longitude': 113.92744893, 'latitude': 22.54030351, 'address': '', 'creatorId': '13b627fbd7f240e2a3b62ce16d64924b', 'creatorName':     function clickRow(obj){
        $("#detailBody").children("tr").attr("style","font-family: Consolas");
        $(obj).attr("style","font-family: Consolas; background-color: #b0d877");
    }

    function details(obj) {
        if ($(obj).text() == '展开') {
            var len = $(obj).parent().parent().children().length;
            var detailLog = "";
            var logs = resultData["testResult"][parseInt($(obj).attr("buttonIndex"))]["log"];
            $(obj).text("收缩");
            $(obj).removeClass("btn-primary");
            $(obj).addClass("btn-danger");
            $.each(logs, function (i, n) {
                detailLog = detailLog + "<p>" + n + "</p>";
            });
            $(obj).parent().parent().after("<tr><td colspan='" + len + "'><div style='font-family: Consolas;font-size:12px'>" + detailLog + "</div></td></tr>");
        } else if ($(obj).text() == '收缩') {
            $(obj).parent().parent().next().remove();
            $(obj).text("展开");
            $(obj).removeClass("btn-danger");
            $(obj).addClass("btn-primary");
        }

    }
    $(function () {
        $("#testName").text(resultData["testName"]);
        $("#testPass").text(resultData["testPass"]);
        $("#testFail").text(resultData["testFail"]);
        $("#testSkip").text(resultData["testSkip"]);
        $("#testAll").text(resultData["testAll"]);
        $("#beginTime").text(resultData["beginTime"]);
        $("#totalTime").text(resultData["totalTime"]);
        $("#filterAll").text(resultData["testAll"]);
        $("#filterOk").text(resultData["testPass"]);
        $("#filterFail").text(resultData["testFail"]);
        $("#filterSkip").text(resultData["testSkip"]);
        var classNames = [];
        var results = [];
        $.each(resultData["testResult"], function (i, n) {
            if (classNames.indexOf(n["className"]) == -1) {
                classNames.push(n["className"]);
            }
            if (results.indexOf(n["status"]) == -1) {
                results.push(n["status"]);
            }
        });

        $.each(classNames, function (i, n) {
            $("#filterClass").append("<option value='" + n + "' hassubinfo='true'>" + n + "</option>");
        });
        $.each(results, function (i, n) {
            $("#filterResult").append("<option value='" + n + "' hassubinfo='true'>" + n + "</option>");
        });

        $("#filterClass").chosen({search_contains: true});
        $("#filterResult").chosen({search_contains: true});

        function generateResult(className, caseResult) {
            $("#detailBody").children().remove();
            var filterAll = 0;
            var filterOk = 0;
            var filterFail = 0;
            var filterSkip = 0;
            $.each(resultData["testResult"], function (i, n) {
                if ((className == "" || n["className"] == className) && (caseResult == "" || n["status"] == caseResult)) {
                    filterAll += 1;
                    var status = "";
                    if (n["status"] == '成功') {
                        filterOk += 1;
                        status = "<td><span class='text-navy'>成功</span></td>";
                    } else if (n["status"] == '失败') {
                        filterFail += 1;
                        status = "<td><span class='text-danger'>失败</span></td>";
                    } else if (n["status"] == '跳过') {
                        filterSkip += 1;
                        status = "<td><span class='text-warning'>跳过</span></td>";
                    } else {
                        status = "<td><span>" + n["status"] + "</span></td>";
                    }
                    var tr = "<tr style='font-family: Consolas'>" +
                        "<td>" + (i + 1) + "</td>" +
                        "<td>" + n["className"] + "</td>" +
                        "<td>" + n["methodName"] + "</td>" +
                        "<td>" + n["description"] + "</td>" +
                        "<td>" + n["spendTime"] + "</td>" +
                        status + "<td><button type='button' onclick='details(this)' buttonIndex='" + i + "' class='btn btn-primary btn-xs' style='margin-bottom: 0px'>展开</button></td></tr>"
                    $("#detailBody").append(tr);
                }
            });
            $("#filterAll").text(filterAll);
            $("#filterOk").text(filterOk);
            $("#filterFail").text(filterFail);
            $("#filterSkip").text(filterSkip);
        }

        generateResult("", "");

        $("#filterClass").on('change', function () {
            var className = $("#filterClass").val();
            var caseResult = $("#filterResult").val();
            generateResult(className, caseResult);
        });

        $("#filterResult").on('change', function () {
            var className = $("#filterClass").val();
            var caseResult = $("#filterResult").val();
            generateResult(className, caseResult);
        });

        //$(".chosen-select").trigger("chosen:updated");

        function pie() {
            var option = {
                title: {
                    text: '测试用例运行结果',
                    subtext: '',
                    x: 'center'
                },
                tooltip: {
                    trigger: 'item',
                    formatter: "{a} <br/>{b} : {c} ({d}%)"
                },
                legend: {
                    orient: 'vertical',
                    left: 'left',
                    data: ['失败', '跳过', '成功']
                },
                series: [
                    {
                        name: '运行结果',
                        type: 'pie',
                        radius: '55%',
                        center: ['50%', '60%'],
                        data: [
                            {value: resultData["testFail"], name: '失败'},
                            {value: resultData["testSkip"], name: '跳过'},
                            {value: resultData["testPass"], name: '成功'}
                        ],
                        itemStyle: {
                            emphasis: {
                                shadowBlur: 10,
                                shadowOffsetX: 0,
                                shadowColor: 'rgba(0, 0, 0, 0.5)'
                            }
                        }
                    }
                ]
            };
            var chart = echarts.init(document.getElementById("echarts-map-chart"));
            chart.setOption(option);
        }

        pie();
    });
